function checkStrings(s1: string, s2: string): boolean {
    // Create frequency maps for even and odd indices for s1 and s2
    const s1Even = new Map<string, number>();
    const s1Odd = new Map<string, number>();
    const s2Even = new Map<string, number>();
    const s2Odd = new Map<string, number>();

    // Populate the frequency maps
    for (let i = 0; i < s1.length; i++) {
        const charS1 = s1[i];
        const charS2 = s2[i];
        if (i % 2 === 0) { // Even index
            s1Even.set(charS1, (s1Even.get(charS1) || 0) + 1);
            s2Even.set(charS2, (s2Even.get(charS2) || 0) + 1);
        } else { // Odd index
            s1Odd.set(charS1, (s1Odd.get(charS1) || 0) + 1);
            s2Odd.set(charS2, (s2Odd.get(charS2) || 0) + 1);
        }
    }

    // Helper function to compare maps
    const mapsAreEqual = (map1: Map<string, number>, map2: Map<string, number>): boolean => {
        if (map1.size !== map2.size) return false;
        for (let [key, val] of map1) {
            if (!map2.has(key) || map2.get(key) !== val) return false;
        }
        return true;
    };

    // Compare even and odd frequency maps
    return mapsAreEqual(s1Even, s2Even) && mapsAreEqual(s1Odd, s2Odd);
}
